SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";

CREATE TABLE IF NOT EXISTS addlocations (
  id int(11) NOT NULL,
  `name` varchar(250) NOT NULL,
  url varchar(500) NOT NULL,
  imageurl varchar(500) NOT NULL,
  phone varchar(20) DEFAULT NULL,
  address varchar(500) DEFAULT NULL,
  rating decimal(10,0) DEFAULT NULL,
  latitude decimal(18,12) DEFAULT NULL,
  longitude decimal(18,12) DEFAULT NULL
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;


CREATE TABLE IF NOT EXISTS removelocations (
  id int(11) NOT NULL,
  locationid varchar(255) NOT NULL
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;


CREATE TABLE IF NOT EXISTS zipcoordinates (
  zip int(11) NOT NULL,
  latitude decimal(18,12) NOT NULL,
  longitude decimal(18,12) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



ALTER TABLE addlocations
  ADD PRIMARY KEY (id);

ALTER TABLE removelocations
  ADD PRIMARY KEY (id);

ALTER TABLE zipcoordinates
  ADD PRIMARY KEY (zip);


ALTER TABLE addlocations
  MODIFY id int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=2;
ALTER TABLE removelocations
  MODIFY id int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=2;